- (void)testExample
{
    NSString *base64 = [fichero substringFromIndex:2];
    base64 = [CADESSignUtils urlSafeDecode:base64];
    NSData *encoded = [CADESSignUtils base64DecodeString: base64];
    NSData *decoded = NULL;
        
    decoded = [CADESSignUtils DesDecrypt: clave:encoded];
     
    //deshacemos el pading especial
    NSData *finalDecoded = [NSData dataWithBytes: encoded length:decoded.length - [[fichero substringToIndex:1] intValue] ];

    
    NSString *datosInUse = [CADESSignUtils encodeBase64:finalDecoded];
    
    NSLog(@"%@",datosInUse);
}

